import React from "react";

const Home = () => {
  let email = localStorage.getItem('email')
  let password = localStorage.getItem('password')
  let name = localStorage.getItem('name')

  return(
    <>
    <div style={{fontSize: "3rem", textAlign: "center", margin: "1%"}}>Dashboard</div>
<h1>{email}</h1>
<h1>{password}</h1>
<h1>{name}</h1>
    </>
  )

};

export default Home;
